import React from 'react'
import Layout from '../components/layout'

export default function NewsSection(props) {
    return (
        <Layout>
            <h1>Headline</h1>
            <ul>
                {props.news.map(news => (
                    <li>
                        <a href={news.url} target="_blank">{news.title}</a>
                    </li>
                ))}
            </ul>
        </Layout>
    )
}
